import React, { useEffect, useState } from "react";
import api from "../../axiosConfig";
import Header from "../../Header";
import "./UserDashboard.css";
import { useNavigate } from "react-router-dom";

const UserDashboard = () => {
  const navigate = useNavigate();
  const [username, setUsername] = useState("");
  const [feedbacks, setFeedbacks] = useState([]);
  const [view, setView] = useState("submitted"); // default view

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/Login");
      return;
    }

    const payload = JSON.parse(atob(token.split(".")[1]));
    setUsername(payload["http://schemas.microsoft.com/ws/2008/06/identity/claims/name"]);

    fetchFeedbacks();
  }, []);

  const fetchFeedbacks = async () => {
    try {
      const res = await api.get("Feedback/my-feedbacks");
      setFeedbacks(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/Login");
  };

  return (
    <div className="dashboard-container">
      {/* Persistent header */}
     

      {/* Middle content */}
      <main className="dashboard-content">
        {view === "submit" && (
          <div className="content-box">
            <h3>Submit New Feedback</h3>
            <p>Redirect or load the feedback form here.</p>
          </div>
        )}

        {view === "recent" && (
          <div className="content-box">
            <h3>Recent Feedback Status</h3>
            <table>
              <thead>
                <tr>
                  <th>Mentor</th>
                  <th>Week</th>
                  <th>Submitted On</th>
                  <th>Status</th>
                </tr>
              </thead>
              <tbody>
                {feedbacks.slice(-5).reverse().map(f => (
                  <tr key={f.id}>
                    <td>{f.mentorName}</td>
                    <td>{f.week}</td>
                    <td>{f.createdAt ? new Date(f.createdAt).toLocaleDateString() : "N/A"}</td>
                    <td>{f.status}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}

        {view === "submitted" && (
          <div className="content-box">
            <h3>All Submitted Feedbacks</h3>
            <table>
              <thead>
                <tr>
                  <th>Mentor</th>
                  <th>Week</th>
                  <th>Submitted On</th>
                  <th>Status</th>
                </tr>
              </thead>
              <tbody>
                {feedbacks.length > 0 ? feedbacks.map(f => (
                  <tr key={f.id}>
                    <td>{f.mentorName}</td>
                    <td>{f.week}</td>
                    <td>{f.createdAt ? new Date(f.createdAt).toLocaleDateString() : "N/A"}</td>
                    <td>{f.status}</td>
                  </tr>
                )) : (
                  <tr>
                    <td colSpan="4">No feedbacks submitted yet.</td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        )}
      </main>
    </div>
  );
};

export default UserDashboard;
